import React from 'react';
import '../App.css';

function LoginForm() {

    function submitLogin(e) {
        e.preventDefault();
    }

    return <form className='loginForm'>
            <input type='email' name='email' />
            <input type='password' name='password' />
            <button onClick={submitLogin}>Login</button>
        </form>
}

export default LoginForm;
